import React from 'react';
import Aux from '../../hoc/Aux';
import classes from './Layout.css';

const layout = ( props ) => (
    <Aux>
        <div>Toolbar, SlideDrawer, backdrop</div>
        <main className>
            {props.children}
        </main>
    </Aux>
);

export default layout;
